import React from 'react';

import './app-header.css';
import styled from 'styled-components';

const Header = styled.div`
    display: flex;
    align-items: flex-end;
    justify-content: space-between;
`

const AppHeader = () => {
    return (
        <Header>
            <h1>Anton Demin</h1>
            <h2>5 posts, 0 liked</h2>
        </Header>
    )
}

export default AppHeader;
